typedef struct flappyBird
{
    int life;
    int x;
    int y;
} flappyBird;

typedef struct pipe
{
    int x;
    int up_height;
    int low_height;
} pipe;

pipe pipes[100];

void plot_pixel(int x, int y, short int line_color);
void draw_background(int x, int y, const unsigned char *flappy_bg, volatile int pixel_buffer_address);
void draw_string(int x, int y, char str[]);
void draw_char(int x, int y, char letter);
void clear_screen();
void draw_image();
void draw_pipe(pipe pipes);
pipe random_init();
void wait_for_vsync();
void shiftPipesToLeft(pipe pipes[], int *num_of_pipe);

int main(void)
{
    volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
    /* Read location of the pixel buffer from the pixel buffer controller */
    pixel_buffer_start = *pixel_ctrl_ptr;

    int delayX = 0;
    int num_of_pipe = 1;

    pipes[0] = random_init();

    /* set front pixel buffer to Buffer 1 */
    *(pixel_ctrl_ptr + 1) = (int)&Buffer1; // first store the address in the  back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_vsync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
    pixel_buffer_start = *pixel_ctrl_ptr;
    // clear_screen(); // pixel_buffer_start points to the pixel buffer

    draw_image();

    /* set back pixel buffer to Buffer 2 */
    *(pixel_ctrl_ptr + 1) = (int)&Buffer2;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer

    while (1)
    {
        // draw_background(0, 0, flappy_bg, pixel_buffer_start);
        // clear_screen();

        draw_image();

        // Update and draw pipes
        for (int i = 0; i < num_of_pipe; ++i)
        {
            if (pipes[i].x + pipe_width < 0)
            { // Pipe is off-screen
                if (num_of_pipe <= 4)
                {
                    // If we haven't reached the maximum number of pipes yet,
                    // simply recycle this pipe and move it to the right.
                    pipes[i] = random_init();
                    pipes[i].x = 320; // Position it to start from the right again
                }
                // If we have more than 4 pipes, this block isn't needed
                // because we'll always have 4 pipes on screen, and we'll recycle them below.
            }
            else
            {
                pipes[i].x -= 10; // Move the pipe left
            }
            draw_pipe(pipes[i]);
        }

        // Recycle the leftmost pipe if max pipes reached and it's time for a new one
        if (delayX == 50 && num_of_pipe >= 4)
        {
            // Find the leftmost pipe and recycle it
            int leftMostIndex = 0;
            for (int j = 1; j < num_of_pipe; j++)
            {
                if (pipes[j].x < pipes[leftMostIndex].x)
                {
                    leftMostIndex = j;
                }
            }
            pipes[leftMostIndex] = random_init();
            pipes[leftMostIndex].x = 320; // Move recycled pipe to the right
            delayX = 0;
        }
        else if (num_of_pipe < 4 && delayX == 30)
        {
            // If we haven't reached 4 pipes, add a new one instead of recycling
            pipes[num_of_pipe++] = random_init();
            delayX = 0;
        }
        else
        {
            delayX++;
        }

        // draw_string(20, 20, "Start the game");
        wait_for_vsync();                           // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
    }
}


